// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./NFTMarketplace.sol";
import "./TransferFunds.sol";

contract NFTAuction is ReentrancyGuard {
    using SafeMath for uint256;

    struct Offer {
        address payable bidder;
        uint256 price;
        uint256 timestamp;
        bool active;
    }

    mapping(uint256 => Offer[]) public tokenIdToOffers;
    NFTMarketplace private nftMarketplaceContract;
    TransferFunds private transferFundsContract;

    event OfferMade(
        uint256 indexed tokenId,
        address bidder,
        uint256 price,
        uint256 timestamp
    );
    event OfferCanceled(uint256 indexed tokenId, address bidder);
    event OfferAccepted(uint256 indexed tokenId, address bidder, uint256 price);
    event OffersExpired(uint256 indexed tokenId, uint256 count);

    constructor(address transferFundsAddress) {
        transferFundsContract = TransferFunds(payable(transferFundsAddress));
    }

    function makeOffer(
        uint256 tokenId,
        uint256 price,
        uint256 timestamp
    ) external payable nonReentrant {
        require(msg.value == price, "Ether sent must equal the offer price");
        _cancelExpiredOffers(tokenId);
        Offer memory newOffer = Offer({
            bidder: payable(msg.sender),
            price: price,
            timestamp: timestamp,
            active: true
        });

        tokenIdToOffers[tokenId].push(newOffer);

        // Record transaction in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(address(this)),
            price,
            string(abi.encodePacked("Offer made for NFT #", _uintToString(tokenId)))
        );

        emit OfferMade(tokenId, msg.sender, price, timestamp);
    }

    function unmakeOffer(uint256 tokenId) external nonReentrant {
        Offer[] storage offers = tokenIdToOffers[tokenId];
        bool found = false;
        uint256 refundAmount = 0;

        for (uint256 i = 0; i < offers.length; i++) {
            Offer storage offer = offers[i];
            if (offer.bidder == msg.sender && offer.active) {
                offer.active = false;
                refundAmount = offer.price;

                // Record refund transaction in TransferFunds
                transferFundsContract.addDataToBlockChain(
                    offer.bidder,
                    refundAmount,
                    string(abi.encodePacked("Offer cancelled for NFT #", _uintToString(tokenId)))
                );

                offer.bidder.transfer(refundAmount);
                emit OfferCanceled(tokenId, msg.sender);
                found = true;
                break;
            }
        }

        require(found, "No active offer found for caller");
    }

    function acceptOffer(uint256 tokenId) external nonReentrant {
        Offer[] storage offers = tokenIdToOffers[tokenId];
        require(offers.length > 0, "No offers available");
        _cancelExpiredOffers(tokenId);

        // Find highest offer
        uint256 highestOfferIndex = 0;
        uint256 highestPrice = 0;
        for (uint256 i = 0; i < offers.length; i++) {
            if (offers[i].active && offers[i].price > highestPrice) {
                highestPrice = offers[i].price;
                highestOfferIndex = i;
            }
        }

        Offer storage highestOffer = offers[highestOfferIndex];
        require(highestOffer.active, "Highest offer is not active");
        require(
            highestOffer.bidder != address(0),
            "Highest offer bidder is zero address"
        );

        highestOffer.active = false;

        // Refund other offers
        for (uint256 i = 0; i < offers.length; i++) {
            if (i != highestOfferIndex && offers[i].active) {
                offers[i].active = false;

                // Record refund transaction in TransferFunds
                transferFundsContract.addDataToBlockChain(
                    offers[i].bidder,
                    offers[i].price,
                    string(abi.encodePacked("Offer refunded for NFT #", _uintToString(tokenId)))
                );

                offers[i].bidder.transfer(offers[i].price);
            }
        }

        emit OfferAccepted(tokenId, highestOffer.bidder, highestOffer.price);
    }

    function handleFundTransfer(
        address payable seller,
        uint256 highestPrice
    ) external nonReentrant {
        // Record payment transaction in TransferFunds
        transferFundsContract.addDataToBlockChain(
            seller,
            highestPrice,
            string(abi.encodePacked("Payment for NFT sale"))
        );

        // Transfer funds to the seller
        (bool success, ) = seller.call{value: highestPrice}("");
        require(success, "Transfer to seller failed");
    }

    function getHighestBidder(
        uint256 tokenId
    ) external view returns (address, uint256) {
        Offer[] storage offers = tokenIdToOffers[tokenId];
        uint256 highestPrice = 0;
        address highestBidder = address(0);
        for (uint256 i = 0; i < offers.length; i++) {
            if (offers[i].active && offers[i].price > highestPrice) {
                highestPrice = offers[i].price;
                highestBidder = offers[i].bidder;
            }
        }

        return (highestBidder, highestPrice);
    }

    function getOffers(uint256 tokenId) public view returns (Offer[] memory) {
        return tokenIdToOffers[tokenId];
    }

    function cancelAllOffers(uint256 tokenId) external nonReentrant {
        Offer[] storage offers = tokenIdToOffers[tokenId];
        uint256 refundsCount = 0;

        for (uint256 i = 0; i < offers.length; i++) {
            if (offers[i].active) {
                offers[i].active = false;

                // Record refund transaction in TransferFunds
                transferFundsContract.addDataToBlockChain(
                    offers[i].bidder,
                    offers[i].price,
                    string(abi.encodePacked("Offer refunded due to cancellation for NFT #", _uintToString(tokenId)))
                );

                offers[i].bidder.transfer(offers[i].price);
                refundsCount++;
            }
        }

        emit OffersExpired(tokenId, refundsCount);
    }

    function _cancelExpiredOffers(uint256 tokenId) internal {
        Offer[] storage offers = tokenIdToOffers[tokenId];
        uint256 currentTime = block.timestamp;
        uint256 refundsCount = 0;

        for (uint256 i = 0; i < offers.length; i++) {
            // Check if offer has expired (current time > 1.5 * timestamp)
            if (offers[i].active && currentTime > offers[i].timestamp.add(offers[i].timestamp.div(2))) {
                offers[i].active = false;

                // Record refund transaction in TransferFunds
                transferFundsContract.addDataToBlockChain(
                    offers[i].bidder,
                    offers[i].price,
                    string(abi.encodePacked("Offer refunded due to expiry for NFT #", _uintToString(tokenId)))
                );

                payable(offers[i].bidder).transfer(offers[i].price);
                refundsCount++;
            }
        }

        if (refundsCount > 0) {
            emit OffersExpired(tokenId, refundsCount);
        }
    }

    // Utility function to convert uint to string
    function _uintToString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }

        uint256 temp = value;
        uint256 digits;

        while (temp != 0) {
            digits++;
            temp /= 10;
        }

        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }

        return string(buffer);
    }

    // Allow contract to receive ETH directly
    receive() external payable {
        // Record direct ETH transfer in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(address(this)),
            msg.value,
            "Direct ETH transfer to auction contract"
        );
    }

    // Fallback function in case of incorrect function calls
    fallback() external payable {
        // Record fallback ETH transfer in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(address(this)),
            msg.value,
            "Fallback: Direct ETH transfer to auction contract"
        );
    }
}

contracts/NFTMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

// INTERNAL IMPORT FOR NFT OPENZIPLINE
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./NFTAuction.sol";
import "./TransferFunds.sol";

contract NFTMarketplace is ERC721URIStorage, ReentrancyGuard {
    using Counters for Counters.Counter;
    using SafeMath for uint256;

    Counters.Counter private _tokenIds;
    Counters.Counter private _itemsSold;

    uint256 listingPrice = 0.000015 ether;
    address payable owner;

    mapping(uint256 => MarketItem) private idToMarketItem;
    NFTAuction private auctionContract;
    TransferFunds private transferFundsContract;

    struct MarketItem {
        uint256 tokenId;
        address payable seller;
        address payable owner;
        uint256 price;
        bool sold;
        bool canceled;
        uint256 timestamp;
    }
    event MarketItemCreated(
        uint256 indexed tokenId,
        address seller,
        address owner,
        uint256 price,
        bool sold,
        bool canceled,
        uint256 timestamp
    );
    event MarketItemSold(uint256 indexed tokenId, address buyer, uint256 price);
    // Constructor
    constructor(
        address _auctionContractAddress,
        address _transferFundsAddress
    ) ERC721("Metaverse Tokens", "METT") {
        owner = payable(msg.sender);
        auctionContract = NFTAuction(payable(_auctionContractAddress));
        transferFundsContract = TransferFunds(payable(_transferFundsAddress));
    }

    function updateListingPrice(uint256 _listingPrice) public {
        listingPrice = _listingPrice;
    }

    function getListingPrice() public view returns (uint256) {
        return listingPrice;
    }

    function createToken(
        string memory tokenURI,
        uint256 price,
        uint256 timesAuctions
    ) public payable returns (uint256) {
        require(
            msg.value == listingPrice,
            "Price must be equal to listing price"
        );
        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();
        _mint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);
        createMarketItem(newTokenId, price, timesAuctions);

        // Record listing fee in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(address(this)),
            listingPrice,
            string(abi.encodePacked("Listing fee for NFT #", _uintToString(newTokenId)))
        );

        return newTokenId;
    }

    function createMarketItem(
        uint256 tokenId,
        uint256 price,
        uint256 timesAuctions
    ) private {
        require(price > 0, "Price must be greater than 0");

        idToMarketItem[tokenId] = MarketItem(
            tokenId,
            payable(msg.sender),
            payable(address(this)),
            price,
            false,
            false,
            timesAuctions
        );
        _transfer(msg.sender, address(this), tokenId);
        emit MarketItemCreated(
            tokenId,
            msg.sender,
            address(this),
            price,
            false,
            false,
            timesAuctions
        );
    }

    function resellToken(
        uint256 tokenId,
        uint256 price,
        uint256 timeActions
    ) public payable nonReentrant {
        require(
            idToMarketItem[tokenId].owner == msg.sender,
            "Only item owner can perform this operation"
        );
        require(
            msg.value == listingPrice,
            "Price must be equal to listing price"
        );
        idToMarketItem[tokenId].timestamp = timeActions;
        idToMarketItem[tokenId].sold = false;
        idToMarketItem[tokenId].canceled = false;
        idToMarketItem[tokenId].price = price;
        idToMarketItem[tokenId].seller = payable(msg.sender);
        idToMarketItem[tokenId].owner = payable(address(this));
        if (_itemsSold.current() > 0) {
            _itemsSold.decrement();
        }
        _transfer(msg.sender, address(this), tokenId);

        // Record listing fee in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(address(this)),
            listingPrice,
            string(abi.encodePacked("Relisting fee for NFT #", _uintToString(tokenId)))
        );
    }

    function createMarketSale(uint256 tokenId) public payable nonReentrant {
        cancelExpiredMarketItems();
        uint256 price = idToMarketItem[tokenId].price;
        address payable seller = idToMarketItem[tokenId].seller;
        require(
            msg.value == price,
            "Please submit the asking price in order to complete the purchase"
        );
        idToMarketItem[tokenId].owner = payable(msg.sender);
        idToMarketItem[tokenId].sold = true;
        _itemsSold.increment();
        _transfer(address(this), msg.sender, tokenId);

        // Record listing fee payment in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(owner),
            listingPrice,
            string(abi.encodePacked("Marketplace fee for NFT #", _uintToString(tokenId)))
        );

        payable(owner).transfer(listingPrice);

        // Record sale payment in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(seller),
            msg.value,
            string(abi.encodePacked("Payment for NFT #", _uintToString(tokenId), " sale"))
        );

        seller.transfer(msg.value);
        idToMarketItem[tokenId].seller = payable(address(0));

        // Cancel all offers since the NFT was sold directly
        auctionContract.cancelAllOffers(tokenId);
    }

    function cancelMarketItem(uint256 tokenId) public nonReentrant {
        MarketItem storage item = idToMarketItem[tokenId];
        require(
            item.seller == msg.sender,
            "Only item seller can perform this operation"
        );
        require(item.sold == false, "Cannot cancel a sold item");

        // Cancel all offers and refund bidders
        auctionContract.cancelAllOffers(tokenId);

        _itemsSold.increment();
        item.owner = item.seller;
        item.seller = payable(address(0));
        item.sold = false;
        item.canceled = true;
        _transfer(address(this), msg.sender, tokenId);
    }

    function acceptOffer(uint256 tokenId) external nonReentrant {
        MarketItem storage item = idToMarketItem[tokenId];
        require(
            item.seller == msg.sender,
            "Only item seller can accept offers"
        );

        (address highestBidder, uint256 highestPrice) = auctionContract
            .getHighestBidder(tokenId);

        require(highestBidder != address(0), "Highest bidder is zero address");
        // Ensure the auction contract has enough balance
        require(
            address(auctionContract).balance >= highestPrice,
            "Insufficient balance in auction contract"
        );

        // Accept the offer, this will refund other offers internally
        auctionContract.acceptOffer(tokenId);

        // Transfer NFT to the highest bidder
        _transfer(address(this), highestBidder, tokenId);

        // Transfer funds to the seller through the auction contract
        // This will record the transaction in TransferFunds
        auctionContract.handleFundTransfer(item.seller, highestPrice);

        // Record marketplace fee in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(owner),
            listingPrice,
            string(abi.encodePacked("Marketplace fee for NFT #", _uintToString(tokenId), " offer acceptance"))
        );

        // Pay marketplace fee to owner
        payable(owner).transfer(listingPrice);

        // Update market item status
        item.owner = payable(highestBidder);
        item.sold = true;
        item.seller = payable(address(0)); // Set seller to zero address to avoid NFT in your bag

        emit MarketItemSold(tokenId, highestBidder, highestPrice);
    }

    function cancelExpiredMarketItems() public {
        uint256 itemCount = _tokenIds.current();
        for (uint256 i = 1; i <= itemCount; i++) {
            if (
                idToMarketItem[i].owner == address(this) &&
                !idToMarketItem[i].canceled
            ) {
                // Kiểm tra nếu thời gian đã hết hạn
                if (block.timestamp >= idToMarketItem[i].timestamp) {
                    // Hủy MarketItem và chuyển token về cho người bán
                    idToMarketItem[i].canceled = true;

                    // Cancel all offers for this item
                    auctionContract.cancelAllOffers(i);

                    _transfer(
                        address(this),
                        idToMarketItem[i].seller,
                        idToMarketItem[i].tokenId
                    );
                }
            }
        }
    }

    // Utility function to convert uint to string
    function _uintToString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }

        uint256 temp = value;
        uint256 digits;

        while (temp != 0) {
            digits++;
            temp /= 10;
        }

        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }

        return string(buffer);
    }

    // The rest of the code remains unchanged
    function fetchMarketItem() public view returns (MarketItem[] memory) {
        uint256 itemCount = _tokenIds.current();
        uint256 unsoldItemCount = 0;
        uint256 currentIndex = 0;
        MarketItem[] memory items;

        for (uint256 i = 0; i < itemCount; i++) {
            if (
                idToMarketItem[i + 1].owner == address(this) &&
                !idToMarketItem[i + 1].canceled
            ) {
                unsoldItemCount += 1;
            }
        }

        items = new MarketItem[](unsoldItemCount);

        for (uint256 i = 0; i < itemCount; i++) {
            if (
                idToMarketItem[i + 1].owner == address(this) &&
                !idToMarketItem[i + 1].canceled
            ) {
                uint256 currentId = i + 1;
                items[currentIndex] = idToMarketItem[currentId];
                currentIndex += 1;
            }
        }

        return items;
    }

    function fetchMyNFTs() public view returns (MarketItem[] memory) {
        uint256 totalItemCount = _tokenIds.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;
        MarketItem[] memory items;

        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].owner == msg.sender) {
                itemCount += 1;
            }
        }

        items = new MarketItem[](itemCount);

        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].owner == msg.sender) {
                uint256 currentId = i + 1;
                items[currentIndex] = idToMarketItem[currentId];
                currentIndex += 1;
            }
        }

        return items;
    }

    function fetchItemsListed() public view returns (MarketItem[] memory) {
        uint256 totalItemCount = _tokenIds.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;
        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].seller == msg.sender) {
                itemCount += 1;
            }
        }
        MarketItem[] memory items = new MarketItem[](itemCount);
        for (uint256 i = 0; i < totalItemCount; i++) {
            if (idToMarketItem[i + 1].seller == msg.sender) {
                uint256 currentId = i + 1;
                MarketItem storage currentItem = idToMarketItem[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }
        return items;
    }

    function transferNFT(uint256 tokenId, address to) public nonReentrant {
        require(
            idToMarketItem[tokenId].owner == msg.sender,
            "Only the owner of the NFT can transfer it"
        );
        require(to != address(0), "Cannot transfer to the zero address");
        _transfer(msg.sender, to, tokenId);

        // Update the market item owner if the NFT is listed in the marketplace
        if (idToMarketItem[tokenId].owner == msg.sender) {
            idToMarketItem[tokenId].owner = payable(to);
        }
    }

    // Allow contract to receive ETH
    receive() external payable {
        // Record the received funds in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(msg.sender),
            msg.value,
            "Direct ETH transfer to marketplace"
        );
    }

    // Fallback function in case of incorrect function calls
    fallback() external payable {
        // Record the received funds in TransferFunds
        transferFundsContract.addDataToBlockChain(
            payable(msg.sender),
            msg.value,
            "Fallback: Direct ETH transfer to marketplace"
        );
    }
}

contracts/TransferFunds.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract TransferFunds {
    uint256 transactionCount;

    event TransferEvent(
        address from, 
        address receiver,
        uint256 amount,
        string message,
        uint256 timestamp
    );

    struct TransferFundsStruck {
        address sender;
        address receiver;
        uint256 amount;
        string message;
        uint256 timestamps;
    }
    TransferFundsStruck[] transactions;

    function addDataToBlockChain(address payable receiver, uint256 amount, string memory message) public {
        transactionCount += 1;
        transactions.push(
            TransferFundsStruck(msg.sender,receiver, amount, message,block.timestamp)
        );
        emit TransferEvent(msg.sender, receiver, amount, message, block.timestamp);
    }

    function getAllTransaction()
        public 
        view
        returns (TransferFundsStruck[] memory)
        {
            return transactions;
        }
    function getTransactionCount() public view returns(uint256){
        return transactionCount;
    }

    // Allow contract to receive ETH directly
    receive() external payable {
        transactionCount += 1;
        transactions.push(
            TransferFundsStruck(msg.sender, payable(address(this)), msg.value, "Direct ETH transfer", block.timestamp)
        );
        emit TransferEvent(msg.sender, address(this), msg.value, "Direct ETH transfer", block.timestamp);
    }

    // Fallback function in case of incorrect function calls
    fallback() external payable {
        transactionCount += 1;
        transactions.push(
            TransferFundsStruck(msg.sender, payable(address(this)), msg.value, "Fallback: Direct ETH transfer", block.timestamp)
        );
        emit TransferEvent(msg.sender, address(this), msg.value, "Fallback: Direct ETH transfer", block.timestamp);
    }
}

